void pad_buff(q7_t *in_buff, q7_t *out_buff, 
              int8_t h_pad_lt, int8_t w_pad_lt, 
              int8_t h_pad_rt, int8_t w_pad_rt,
              int32_t out_h, int32_t out_w, int32_t out_ch) {
  int h, w, d;
  for (h = 0; h < out_h; h++) {
    for (w = 0; w < out_w; w++) {
      for (d = 0; d < out_ch; d++) {
        if (h < h_pad_lt || h >= out_h - h_pad_rt ||
            w < w_pad_lt || w >= out_w - w_pad_rt) {
          *out_buff++ = 0;
        } else {
          *out_buff++ = *in_buff++;
        }
      }
    }
  }
}


